  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:45.377542\",\n\t\"name\": \"pre-restoration-monitoring-at-bandon-marsh-national-wildlife-refuge-2007-2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The loss of tidal wetlands, primarily through
  dike construction and draining, has been identified as a major factor contributing
  to the decline of fish populations and overall productivity of estuaries. Band Marsh
  National Wildlife Refuge (BMNWR) is in the process of conducting a large-scale tidal
  marsh restoration project on the Ni0le'tun Unit (Unit), within the Coquille River
  estuary. Objectives of this project are as follows: describe fish species community
  within and among restoration sites and reference sites before and after construction;
  describe fish species distribution within and among restoration sites and reference
  sites before and after restoration; describe fish species relative abundance within
  and among restoration sites and reference sites before and after construction; collect
  invertebrates to archive from restoration sites and reference sites before and after
  construction.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
